import React from 'react';
import { View, Text } from 'react-native';
import Row from '../components/Row';

const HomeScreen = ({ navigation }) => {
    return (
        <View>
            <Row onPress={() => navigation.navigate('Row', { tituloSeccion: 'culo' })} />
            <Text></Text>
        </View>
    );
};

export default HomeScreen;
